import './Home.css';
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';




function Home() {
  return (
    <Router>  
      <Routes>
      <Route path='/' element={<Home />} />
      </Routes>
    </Router>
  );
}

export default Home;
